import Navbar from './navbar/navbar';
import Header from './header/header';
import Content from './content/content';
import Share from './share/share';
import More from './more/more';
import Footer from './footer/footer';

function App() {
  return (
    <>
    <Navbar />
    <Header />
    <Content />
    <Share />
    <More />
    <Footer />
    </>
  );
}

export default App;
